// src/index.tsx
import React from 'react';
import ReactDOM from 'react-dom/client';  // Importa da nova API do React 18
import App from './App';

const rootElement = document.getElementById('root');

// Verifica se o elemento existe antes de criar a raiz
if (rootElement) {
  const root = ReactDOM.createRoot(rootElement); // Cria a raiz usando a nova API
  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
}
